import Search from "../components/Search.js";
import Navigator from "../components/Navigator.js";
import axios from "axios";
import { getCookie } from "../cookie.js";
import { useState } from "react";
import Header from "../components/Header.js";
import icon_back from "../img/icon/header_back.png";
import { useNavigate } from "react-router-dom";

const SERVER_URL=`https://mapdagu.site/api/friends?search`;

const SearchUser = () => {
    const navigate = useNavigate();
    const [data, setData] = useState;
    const accessToken = getCookie("accessToken");

    const handleOnBack = () => {
        navigate(-1);
    }
    const onSubmit = async(contents) => {
        try{
            axios.get([SERVER_URL, contents].join("="), {headers: {Authorization: accessToken}})
            .then(res => {
                console.log(res.data.content);
                setData(res.data.content.map((item) => ({
                    ...item
                })));
            })
        } catch(error){
            alert(error.response.data.message);
        }
    }
    return(
        <div className="container">
            <div className="header">
                {/* <Header 
                    type={1}
                    leftChild={<button onClick={handleOnBack}>
                        <img alt="back" src={icon_back}/>
                    </button>}
                /> */}
            </div>
            <div className="content">
                <Search onSubmit={onSubmit}/>
            </div>
            <div className="footer">
                <Navigator/>
            </div>
        </div>
    )

}

export default SearchUser;
